(114, 'IPD_ADMISSION_FORM_NOTE', '<strong class=\"colorGreen\">নির্দেশনা সমূহ</strong><br>\r\n	রোগী ভর্তির যেকোন সময় হতে পরবর্তী দিন দুপুর ১২ টা পর্যন্ত ১ দিন গননা করা হবে। <br>\r\n	ভর্তি রোগির মুল্যবান জিনিস পত্র, যেমন- মোবাইল,ঘড়ি,অলংকার, টাকা-পয়সা ইত্যাদি নিজ দায়িত্ব এ রাখতে হবে, চুরি বা হারাণো গেলে কর্তপক্ষ দায়ী থাকিবে না। <br>\r\n	যেকোন লেনদেন রশিদ ছাড়া গ্রহন্যোগ্য নয়।', 'IPD', '2022-09-06 07:46:49', 'admission form footer'),
(115, 'IPD_ADMISSION_FORM_HEADER', '1', 'IPD', '2022-09-06 07:46:49', 'admission form yes=1, keep blank=0'),
(116, 'IPD_RISK_BOND', 'অপারেশন করার সম্মতিপত্র আমি আমার রোগের/ আমার রোগীর চিকিৎসার জন্য ----------------------------------অপেরেশনের এবং সম্ভাব্য সকল প্রকার ঝুঁকি সম্পর্কে ডাক্তার কর্তৃক অবহিত হলাম। অতঃপর আমাকে/আমার রোগীকে আংশিক/সম্পূর্ণ অজ্ঞান করে অপারেশন করতে/করাতে সুস্থ মস্তিষ্কে, সজ্ঞানে, স্বেচ্ছায় সম্মতি প্রদান করলাম। অপেরেশনের সময় কোন নতুন পরিস্থিতির সৃষ্টি হলে রোগীর স্বার্থে যে কোন রকম ব্যবস্থা গ্রহণ করার জন্য কর্তব্যরত সার্জনকে/এনেস্থেটিস্টকে সম্মতি দিলাম। অপারেশন বা অজ্ঞান করার সময় কোন রকম দুর্ঘটনা ঘটলে ক্লিনিক কর্তৃপক্ষ বা ডাক্তারগণ কোন প্রকার দায়ী থাকবেন না।', 'IPD', '2022-09-06 07:46:49', ''),
